INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('049aede6-bc98-4426-a87b-8b36b12c0c25', '4ad29c36351395c7fae277516b07397e', 0, 'stop drinking once you''ve started Negative emotional state - feeling anxious and irritable when you are not drinking What is binge drinking? Binge drinking is a type of alcohol misuse. It means drinking so much at once that your blood alcohol concentration (BAC) level is 0.08% or more. For a man, this usually happens after having 5 or more drinks within a few hours. For a woman, it is after about 4 or more drinks within a few hours. Not everyone who binge drinks has an AUD, but they are at higher risk for getting one. What are the dangers of too much alcohol? Too much alcohol is dangerous. Heavy drinking can increase the risk of certain cancers. It may lead to liver diseases , such as fatty liver disease and cirrhosis . It can also cause damage to the brain and other organs.', '[-0.1646878868341446,-0.08667266368865967,-1.2862703800201416,0.3247940242290497,0.23751167953014374,0.02091876044869423,-0.5398287773132324,0.3299887180328369,0.06654112786054611,0.1619095802307129,0.36985069513320923,0.08262227475643158,-0.45416927337646484,-0.14648093283176422,-0.5730871558189392,0.17834830284118652,-0.09071730822324753,0.5413186550140381,0.2055501490831375,-0.586388111114502,-0.04300945624709129,-0.5134669542312622,0.03399856761097908,-0.023064179345965385,-0.07647905498743057,-0.17181915044784546,-0.1035742536187172,-0.7015150785446167,-0.320295125246048,-0.030646920204162598,-0.7154693603515625,0.3345911204814911,-0.21581293642520905,-0.031359560787677765,0.012040186673402786,-0.15188848972320557,0.01465015858411789,0.5881401896476746,0.35720545053482056,-0.3265504539012909,-0.1789114624261856,-0.11642441153526306,0.7044194936752319,0.21705813705921173,-0.004860250744968653,0.7349402904510498,0.09319321066141129,-0.606086790561676,1.1069220304489136,0.368623286485672,-0.6624295711517